import React from 'react';
import '../../App.css';
import Footer from '../Footer';

export default function Services() {
  return (
    <>
      <div class="services">
          <div class="text-block">
            <h1>About Me</h1>
            <p>What a beautiful sunrise</p>
          </div>
      </div>
      <Footer/>
    </>
  );
}
